import styled from "styled-components/macro";

export const IconGuide = styled.div`
  display: flex;
  justify-content: center;
`;

export const TextContainer = styled.h2`
  text-align: center;
`;

export const Box = styled.div`
  display: grid;
  grid-template-columns: 1fr 1fr;
  margin: 180px;
  text-align: center;
`;
